import Link from 'next/link';
import HamburgerToggle from './HamburgerToggle'

const Navbar = () => (
    <div className="navbar">

        <div className="container">
            <Link href="/">
                <a>Home</a>
            </Link>
            <Link href="/projects">
                <a>Projects</a>
            </Link>
        </div>   
        <style jsx>{`
            a {
                color: black;
                margin: 20px;
                font-size: 2rem;
                font-family: Roboto;
                text-decoration: none;
            }

            a:hover {
                color: #3377cc;
            }
    
            .container {
                text-align: center;
                padding: 2.5vh;
            }

        `} </style>
    </div>

);
  
  export default Navbar;
